import React, { Component} from "react";
// import '../utilities.css'
// import "./Post.css";


class Post extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div>
                <img src={this.props.url}></img>
                <p>{this.props.explanation}</p>
            </div>
        )
    }
};

export default Post;
